import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component } from 'react';

export default class NAV extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <header>
                <div class="navbar">
                    <div class="column column-30">
                        <div class="user-section">
                            <div class="username">
                                <h2>HELLO ADMIN</h2>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="row">
                    <div id="sidebar" class="column">
                        <h5>Navigation</h5>
                        <ul>
                            <li><a href="#"><em class="fa fa-home"></em> Home</a></li>
                            <li><a href="#"><em class="fa fa-home"></em>ADD EMPLOYEE</a></li>
                            <li><a href="#"><em class="fa fa-home"></em>DELETE EMPLOYEE</a></li>
                            <li><a href="#"><em class="fa fa-home"></em>SEARCH EMPLOYEE</a></li>

                        </ul>
                    </div></div>
            </header>
        );
    }
}
